sys_variable_value.value:
(function execute(inputs, outputs) {

  var csp = new GlideRecord('x_g_dis_atat_cloud_service_provider');
  csp.get(inputs.portfolio.csp);

  var cost_request = {
    requestId: gs.generateGUID(),
    portfolioId: inputs.portfolio.csp_portfolio_id.toString(),
    targetCsp: {
      name: csp.name.toString(),
      uri: csp.uri.toString(),
      network: csp.network.toString()
    },
    startDate: inputs.start_date,
    endDate: inputs.end_date
  };

  outputs.cost_request = JSON.stringify(cost_request);
  outputs.cost_request_id = cost_request.requestId;

})(inputs, outputs);

